import './App.css';
import RingChart from './RingChart';


const dataForChart = [
  ["Segment 1", 40, "#ff5733"], // Имя сегмента, значение, цвет
  ["Segment 2", 30, "#33c3ff"],
  ["Segment 3", 20, "#75ff33"],
  ["Segment 4", 10, "#ff33ab"],
];


function App() {
  return (
    <div className="App">
      <RingChart data={dataForChart} />
    </div>
  );
}

export default App;
